sources.../src/assets/styles/components/_categor:
.categories-container {
  min-height: calc(100vh - 200px);
  margin-bottom: 20px;
  position: relative;

  form {
    position: absolute;
    right: 0;
    left: 0;
    top: 0;
    bottom: 0;
    overflow-y: scroll;
  }
}

.collapse-category-btn {
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0;
  padding: 0;
  width: 20px;
  height: 20px;
  font-size: 10px;
  background-color: inherit;
  font-weight: flutter;

  &:hover {
    background-color: black;

    i {
      color: white;
      transform: scale(1.1);
    }
  }

  i {
    font-size: 15px;
    color: black;
  }
}

